import gamesObject from '../games.json';
import { Image } from 'react-bootstrap';

function ListMovies() {
    const games = gamesObject.games;
    return (
        <div className="Container flex">
            <div className="row">
                
                <div className="row justify-content-center g-1">
                    {games.map((game) => (
                        <div key={game.name} className="col-auto">
                            <Image src={game.coverUrl} alt={game.name} width="250" height="375" />
                        </div>
                    ))}
                </div>
            </div>
        </div>
    )
}

export default ListMovies;
